import{_ as l,c as e,o as i,a as t}from"./app.b9792699.js";const m=JSON.parse('{"title":"\uC624\uB298\uC758 \uAE30\uB85D","description":"","frontmatter":{"title":"\uC624\uB298\uC758 \uAE30\uB85D","createBy":"2022-09-30T00:00:00.000Z"},"headers":[],"relativePath":"TIL/202209/20220930.md"}'),o={name:"TIL/202209/20220930.md"},a=t('<br><h2 style="font-size:26px;color:black;">\uC624\uB298\uC758 \uC774\uC57C\uAE30\u{1F9E7}</h2><hr><p>\uC624\uB298\uC740 \uC624\uC804\uADFC\uBB34 &amp; \uC6D4\uAE09\uB0A0 &amp; \uB514\uC9C0\uD14D \uC560\uB4E4\uC774\uB791 \uB178\uB294 \uB0A0 \u314E\u314E \uC774\uBCA4\uD2B8\uAC00 \uB9CE\uC544\uC11C \uB108\uBB34 \uC88B\uB2E4~~ \uC5B4\uC81C \uC624\uB298 \uC0C8\uB85C\uC6B4 \uD504\uB85C\uC81D\uD2B8\uB97C \uD558\uB290\uB77C \uAD6C\uAE00\uB9C1\uC744 \uAC81\uB098\uAC8C \uB9CE\uC774 \uD588\uB2E4. \uCC98\uC74C\uC73C\uB85C \uC9C0\uB300\uB85C \uB41C \uC790\uBC14 \uD504\uB85C\uC81D\uD2B8\uB77C\uC11C,, \uAC71\uC815\uC774 \uB9CE\uC774 \uB41C\uB2E4. \uADF8\uB798\uC11C \uB354 \uC5F4\uC2EC\uD788 \uAD6C\uAE00\uB9C1\uC744 \uD558\uC600\uB2E4. \uC544\uC9C1\uAE4C\uC9C4 \uC21C\uC870\uB86D\uB2E4.. \uC800\uBC88\uCC98\uB7FC \uC0BD\uC9C8\uD558\uC9C0 \uC54A\uAE30 \uC704\uD574\uC11C \uB85C\uB4DC\uB9F5\uB3C4 \uC801\uC5B4\uBCF4\uACE0, \uD574\uC57C\uD560 \uB9AC\uC2A4\uD2B8\uBCC4\uB85C \uC815\uB9AC\uD574 \uAC00\uBA74\uC11C \uD504\uB85C\uC81D\uD2B8\uB97C \uC9C4\uD589\uD558\uACE0 \uC788\uB2E4. \uCA0B\uB4E0 \uC624\uB298\uC740 \uC544\uCE68\uBD80\uD130 \uACFC\uC7A5\uB2D8\uC774\uB791 1\uC2DC\uAC04\uB3D9\uC548 \uCE74\uD398\uC5D0\uC11C \uB180\uC558\uB2E4. \u314E\u314E\uC544\uB2C8\uC9C0 \uB17C\uAC74 \uC544\uB2C8\uACE0 \uC0C1\uB2F4\uC744 \uBC1B\uC558\uB2E4. \uB300\uD559\uAD50\uB97C \uC5B4\uB5BB\uAC8C \uD574\uC57C\uD560\uC9C0~\uC5D0 \uB300\uD55C? \uADF8\uB9AC\uACE0 \uD68C\uC0AC\uC5D0 \uAD00\uB828\uD574\uC11C \uAD81\uAE08\uD588\uB358 \uC810\uC5D0 \uB300\uD574 \uC5EC\uCB64\uBCF4\uBA70 \uD68C\uC0AC\uC5D0 \uB300\uD574 \uC54C\uC544\uAC14\uB2E4. \uC624\uC804\uC5D4 \uADF8\uB7ED\uC800\uB7ED \uC9C0\uB0B4\uB2E4\uAC00 \uC810\uC2EC\uBA39\uACE0 30\uBD84? \uD504\uB85C\uC81D\uD2B8 \uC9C4\uD589\uD558\uB2E4\uAC00 \uD1F4\uADFC\uD588\uB2E4.. \uD760 \uC774\uB7F4\uAC70\uBA74 \uADF8\uB0E5 \uAE08\uC694\uC77C\uC740,, \uC9D1\uC5D0\uC11C \uC5C5\uBB34\uB97C \uBCF4\uB294\uAC83\uB3C4 \uB098\uC058\uC9C0 \uC54A\uC740\uB370..\u314E \uCA0B\uB4E0. \uACFC\uC7A5\uB2D8\uC774\uB791 \uC598\uAE30 \uD558\uBA74\uC11C \uC55E\uC73C\uB85C \uB0B4\uAC00 \uD574\uC57C\uD560 \uAC83\uB4E4\uC774\uB098 \uC5C5\uBB34\uB97C \uB9E1\uC544\uC57C \uD558\uB294 \uBD80\uBD84 \uACF5\uBD80 \uD574\uC57C\uD560 \uAC83\uB4E4\uC5D0 \uB300\uD574 \uC54C\uC544\uBCF4\uB294 \uC2DC\uAC04\uC744 \uAC00\uC838\uC11C \uC88B\uC558\uB2E4. \uC2A4\uD0C0\uD2B8 \uC5C5\uC774\uB77C \uB0B4\uAC00 \uD558\uACE0 \uC2F6\uC740\uAC70 \uD50C\uB7EC\uC2A4, \uD574\uC57C\uD560 \uAC83\uB4E4\uC774 \uB108\uBB34 \uB9CE\uC544 \uC18D\uC73C\uB85C\uB294 \uC880 \uC2E0\uB0AC\uB2E4. \uC544\uC9C1 \u314B\u314B\u314B\u314B\uC2E0\uC785\uC774\uB77C \uADF8\uB7F0\uAC00 \uC5F4\uC815\uC774 \uB9CE\uC544\uC11C \uADF8\uB7F4\uC218\uB3C4? \uC55E\uC73C\uB85C \uC5F4\uC2EC\uD788 \uD574\uC57C\uACA0\uB2E4!!</p><h2 style="font-size:26px;color:black;">\uD68C\uACE0 \u{1F425}</h2><hr><p>\uD68C\uC0AC\uC5D0 \uB098\uC628\uC9C0\uB3C4 \uBC8C\uC368 1\uB2EC\uC774 \uB418\uC5C8\uB2E4. \uB3C4\uC81C\uC5EC\uD589 \uAC14\uB2E4\uC628\uAC8C \uC5CA\uADF8\uC81C \uAC19\uC740\uB370.. \u315C\u315C \uBC8C\uC368 1\uB2EC.. \uC2DC\uAC04\uC774 \uC815\uB9D0 \uBE68\uB9AC \uAC04\uB2E4. \uC2DC\uAC04\uC774 \uBE68\uB9AC \uAC08 \uC218\uB85D \uB354\uB354 \uB9CE\uC774 \uACF5\uBD80\uD574\uC57C \uD558\uB294\uB370 \u315C\u315C \uADF8\uB798\uB3C4 \uC774\uBC88 1\uB2EC\uAC04 \uACFC\uC7A5\uB2D8\uC740 \uB9CE\uC774 \uD55C\uAC70 \uAC19\uC9C0 \uC54A\uB2E4\uACE0 \uD558\uC168\uC9C0\uB9CC! \uB098\uB294 \uBB54\uAC00 \uAD49\uC7A5\uD788 \uB9CE\uC740 \uAC83\uB4E4\uC744 \uD574\uBCF8\uAC70 \uAC19\uC544\uC11C \uC88B\uC558\uB2E4. \uC774\uBC88 1\uB2EC\uB3D9\uC548 \uD574\uBCF8\uAC83\uC744 \uC74A\uC5B4 \uBCF4\uACA0\uB2E4!</p><ol><li>\uB124\uD2B8\uC6CC\uD06C \uAC1C\uB150 \uC7A1\uAE30</li><li>\uAC00\uC0C1\uBA38\uC2E0 \uAD6C\uCD9C ssh \uD1B5\uC2E0</li><li>\uAC00\uC0C1\uBA38\uC2E0 3\uB300 \uAD6C\uCD95 \uC6D0\uACA9 \uC811\uC18D</li><li>\uAC00\uC0C1\uBA38\uC2E0 3\uB300 \uD558\uB461 \uB370\uC774\uD130 \uC218\uC9D1 \uBC0F \uB370\uC774\uD130 \uCC98\uB9AC</li><li>\uD1B0\uCEA3 \uC124\uCE58 \uBC0F \uD3EC\uD2B8\uD3EC\uC6CC\uB529 \uD65C\uC6A9\uD574\uC11C \uBE0C\uB77C\uC6B0\uC800 \uC811\uC18D</li><li>\uBBF8\uB2C8 pc \uAD6C\uC131</li><li>\uC5C5\uBB34) \uAC00\uC0C1\uBA38\uC2E0 \uB124\uD2B8\uC6CC\uD06C \uC124\uC815 \uBC0F \uC6D0\uACA9 \uAC00\uB2A5\uD558\uB3C4\uB85D \uC124\uC815\uD558\uAE30</li><li>\uC138\uBBF8\uB098 \uC9C4\uD589</li><li>\uCF54\uC5D1\uC2A4 \uC804\uC2DC\uD68C \uBC29\uBB38</li><li>\uC790\uBC14 \uC11C\uBC84 \uBAA8\uB2C8\uD130\uB9C1 \uD504\uB85C\uC81D\uD2B8 \uC2DC\uC791 \uC774\uB807\uAC8C \uB9CE\uC740\uAC83\uB4E4\uC744 \uD588\uB2E4. \uC194\uC9C1\uD788 \uC801\uB2E4\uBA74 \uC801\uC740\uAC74\uB370 \uB124\uD2B8\uC6CC\uD06C \uACF5\uBD80\uB97C \uD568\uC73C\uB85C\uC368 \uAE30\uBCF8\uC801\uC778 \uD750\uB984\uC744 \uC81C\uB300\uB85C \uC54C\uAC8C \uB41C\uAC70 \uAC19\uC544 \uB9CC\uC871\uC2A4\uB7FD\uB2E4. \uADF8 \uC804\uC5D4 \uB124\uD2B8\uC6CC\uD06C\uB97C \uACF5\uBD80\uD558\uB294 \uAC83\uC740 \uAC1C\uB150\uB9CC \uC7A1\uACE0 \uC788\uC5C8\uC9C0 \uC774\uB807\uAC8C \uC2E4\uC2B5\uC744 \uD574\uBCF8\uAC74 \uCC98\uC74C\uC774\uC5C8\uAE30\uC5D0 \uB9CE\uC740 \uC9C0\uC2DD\uC744 \uC5BB\uC5B4\uAC04\uAC70 \uAC19\uB2E4. \uB610 \uC774\uBC88 \uD55C\uB2EC\uB3D9\uC548 \uB9CE\uC774 \uBC1C\uC804\uD55C\uAC83\uC774 \uD558\uB098 \uB354 \uC788\uB2E4. \uADF8\uAC83\uC740 \uB9AC\uB205\uC2A4 \uB2E4\uB8E8\uAE30.. \uCC98\uC74C\uC5D4 \uB9AC\uB205\uC2A4 \uC5B4\uB5BB\uAC8C \uD558\uB294\uAC74\uC9C0 root\uAC00 \uBB54\uC9C0 \uC5B4\uB514\uC5D0 \uC4F0\uB294\uAC74\uC9C0 \uC65C \uC4F0\uB294\uAC74\uC9C0 \uC544\uC608 \uBAB0\uB790\uB2E4. \uADF8\uC800 \uBA85\uB839\uC5B4\uB098 vi\uBA54\uBAA8\uC7A5 \uC4F0\uB294 \uC815\uB3C4\uB9CC \uC54C\uACE0 \uC788\uC5C8\uB2E4.. \uC774\uBC88\uC5D0 \uD568\uC73C\uB85C\uC368 \uB9AC\uB205\uC2A4\uB85C \uC0BD\uC9C8\uC744 \uB9CE\uC774 \uD574\uC11C \uADF8\uB7F0\uAC00 \uAC11\uC790\uAE30 \uB9CE\uC774 \uB298\uC740\uAC70 \uAC19\uB2E4. \uAC80\uC0C9\uD574 \uBCF4\uB2C8 \uB9AC\uB205\uC2A4\uB294 \uACF5\uBD80\uBCF4\uB2E8 \uACBD\uD5D8\uC774 \uB9CE\uC774 \uD544\uC694\uD558\uB2E4\uACE0 \uB2E4\uB4E4 \uADF8\uB7AC\uB2E4,. \uCA0B\uB4E0! \uC774\uBC88 \uD55C\uB2EC \uB3D9\uC548 \uB108\uBB34 \uC218\uACE0\uD588\uB2E4\uB294 \uC758\uBBF8\uB85C,, \uB098\uC911\uC5D0 \uC1FC\uD551\uD574\uC57C\uC9C0 \u314E\u314E \uD551\uACC4\uB97C \uB300\uBA74\uC11C \uB098\uC5D0\uAC8C \uC120\uBB3C\uD558\uB294 \uAC83\uB3C4 \uC88B\uC740 \uC2B5\uAD00\uC774\uB77C \uADF8\uB7AC\uB2E4. \u314E\u314E \uACFC\uC7A5\uB2D8 \uD53C\uC15C</li></ol><h4 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h4><h2 style="font-size:26px;color:black;">\uC624\uB298 \uACF5\uBD80\uD55C \uB0B4\uC6A9 \u{1F4CB}</h2><hr><ul><li>\uC2A4\uD504\uB9C1 \uC11C\uBC84</li><li>\uBC31\uC5D4\uB4DC \uB85C\uB4DC\uB9F5\uC5D0 \uB300\uD574 \uC54C\uC544\uBCF4\uAE30</li></ul><h2 style="font-size:26px;color:black;">\uC5B4\uB824\uC6E0\uB358 \uB0B4\uC6A9 \u{1F922}</h2><hr><h2 style="font-size:26px;color:black;">\uAD81\uAE08\uD55C \uB0B4\uC6A9 / \uBD80\uC871\uD55C \uB0B4\uC6A9 \u{1F9D0}</h2><hr><ul><li>rest api\uC5D0 \uB300\uD574 \uB354\uC6B1\uB354 \uACF5\uBD80\uD574\uC57C\uD560\uAC70 \uAC19\uB2E4.</li></ul>',17),r=[a];function s(c,_,h,n,p,d){return i(),e("div",null,r)}const u=l(o,[["render",s]]);export{m as __pageData,u as default};
